import {
  Avatar,
  Card,
  CardHeader,
  CardContent,
  Typography,
  IconButton,
} from "@mui/material";
import FavoriteIcon from "@mui/icons-material/Favorite";
import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { articleFetch } from "../../ReduxPages/ReduxSlices/getArticles-slice";

export default function Articles() {
  const articles = useSelector((state) => state.article);
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(articleFetch());
  }, []);
  console.log(articles.articles);

  let articleMapping = articles.articles.map((article) => (
    <Card key={article.slug} sx={{ position: "relative", pb: "20px" }}>
      <CardHeader
        avatar={<Avatar src="" alt="m" />}
        title="Zaid Saeh"
        subheader="September 14, 2016"
      />
      <CardContent>
        <Typography component={"p"}>{title}</Typography>
        <Typography component={"p"} color="text.secondary">
          body
        </Typography>
      </CardContent>
      <div className="text-end me-5">tags</div>
      <IconButton
        aria-label="add to favorites"
        sx={{ position: "absolute", top: "10px", right: "10px" }}
      >
        <FavoriteIcon />
      </IconButton>
    </Card>
  ));
  return (<>
  {articleMapping}
  </>);
}
